const ListItem= {
    color: "red",
    fontSize: "14px",
    marginLeft: "50px",
    border: "red",
     border: "solid", 
     border: "10px",
     width: "300px",
     height: "100px",
     padding: "50px"
}

function EmployeeListItems(props) {
  return (
    <div className="ListItems" style={ListItem}>
        <h3>{props.name}</h3>
        <p>{props.Title}</p>

        </div>
  );
}


export default EmployeeListItems;
